import React from 'react';
import "./StudentPair.css";
import Student from "./Student"

function StudentPair({data, level}){
    return (
        <div className="student-pair__container">
            <Student
                img={data.image}
                level={level}
                student={data.name}
                info={data.info}
            />
        </div>
    )
}

export default StudentPair;
